import Timer from "./timer";
import React from "react";
import { useNavigate } from "react-router-dom";

const buttonNames = [
    'Seizure',
    'Heart Attack',
    'Stroke',
    'Choke',
    'Diabetes',
    'Blood',
    'Asthma',
    'Broken Bones',
];

const buttonImages = [
    'https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcTkGvOEnYdpethXYTWm3aq_D7_vr17G0VH9HfWCJFmvSGg1f5wS',
    'https://www.bostonmagazine.com/wp-content/uploads/sites/2/2013/11/heart_attack_square.jpg',
    'https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcRdKTmps5DxKjz8NW8YNxUmjD96Ork8p4iJ-8LmLAFSqlitMI8i',
    'https://api.kramesstaywell.com/Content/6066ca30-310a-4170-b001-a4ab013d61fd/ucr-images-v1/Images/83412_1',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSJjbk-cUI9VimD-LvHSraOPMtUACLPIimjMR6d0cYIEV_Wt1Ca',
    'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTtRwUZ2DKfW8D7uimZVAZm6wwaVeTzO_Cwnnw2I_AgebV1nmCt',
    'https://example.com/asthma-image.jpg',
    'https://example.com/broken-bones-image.jpg',
];


export function ButtonContainer() {
    const navigation = useNavigate();
    const buttons = buttonNames.map((name, index) => (
        <button
            key={index}
            className="button"
            style={{
                backgroundImage: `url(${buttonImages[index]})`,
                backgroundSize: 'cover',
                backgroundPosition: 'center',
            }}
            onClick={() => navigation('/' + name.toLowerCase().replace(/\s+/g, '-'))}
        >
            {name}
        </button>
    ));

    return (
        <div className="button-container">
            {buttons}
            <div className="emergency-container">
                <button className="emergency-button">Et </button>
            </div>
            <Timer />
        </div>
    );
}

export default ButtonContainer;
